syntax = "proto3";
package acmain.acmain.v1;

import "acmain/acmain/v1/params.proto";
import "amino/amino.proto";
import "gogoproto/gogo.proto";

option go_package = "acmain/x/acmain/types";

// GenesisState defines the acmain module's genesis state.
message GenesisState {
  // params defines all the parameters of the module.
  Params params = 1 [
    (gogoproto.nullable) = false,
    (amino.dont_omitempty) = true
  ];
}
